content.css:
.filtro-conjugado {
  height: 100%;
  width: 100%;
  display: flex;
  flex-direction: column;
}
.search-bar {
  display: flex;
  align-items: center;
  gap: 6px;
  padding: 4px 0;
}
.search-input-wrap {
  position: relative;
  flex: 1 1 auto;
}
.search-input {
  width: 100%;
  box-sizing: border-box;
  padding: 4px 22px 4px 6px;
  border: 1px solid #ccc;
  border-radius: 2px;
  outline: none;
}
.search-clear {
  position: absolute;
  right: 4px;
  top: 50%;
  transform: translateY(-50%);
  width: 16px;
  height: 16px;
  line-height: 16px;
  text-align: center;
  border: 1px solid #aaa;
  border-radius: 2px;
  font-weight: bold;
  cursor: pointer;
  user-select: none;
}
.list-container {
  overflow-y: auto;
  flex: 1 1 auto;
}
.tree {
  list-style: none;
  margin: 0;
  padding: 0;
}
.node {
  display: flex;
  align-items: center;
  line-height: 1.2;
  word-break: break-word;
  user-select: none;
  cursor: pointer;
}
.node .toggle {
  width: 14px;
  text-align: center;
  margin-right: 4px;
  flex: 0 0 auto;
  cursor: pointer;
}
.node .label {
  margin-left: 4px;
}
.node.selected {
  background: rgba(0, 0, 0, 0.06);
}
.children {
  list-style: none;
  margin: 0;
  padding: 0;
}
